import React from "react";

import "../src/switch.css";

const Switch = () => {
  return (
    <div>
      <label class="ui-switch">
        <input type="checkbox" />
        <div class="slider">
          <div class="circle"></div>
        </div>
      </label>
    </div>
  );
};

export default Switch;
